import React, { Fragment } from 'react';
import './App.scss';
import {
    BrowserRouter as Router,
    Route,
    Switch,
    Redirect,
} from 'react-router-dom';
import { Provider } from 'react-redux';
import store from './redux/store';

function App() {
    return (
        <Provider store={store}>
            <Router>
                <Fragment> </Fragment>
            </Router>
        </Provider>
    );
}

export default App;
